import React from 'react';
import WebContent from '../containers/WebContent.js'
import axios from 'axios'

export default () => {
    const API_KEY = process.env.REACT_APP_SPOON_API_KEY

    const getRecipes = (e) => {
        e.preventDefault();
        axios.get(`https://api.spoonacular.com/recipes/findByIngredients?apiKey=${API_KEY}&ingredients=apples,+flour,+sugar&number=2`)
        .then(response => {
            console.log(response)
        })
    }


    return (
        <>
            <WebContent />
            <button onClick={getRecipes}>Get Search</button>
        </>
    )
}
